import logo from './logo.svg';
import './App.css';
import Header from "./Heading";
import List from "./List";
import React from "react";




const name = "Patrick";
let year = new Date().getFullYear();
let time = new Date().getHours()
function timeChange(time) {
  if(time < 12 ) {
    return "morning"
  } else {
    return "evening"
  }
}


function App() {
  return (
      <div><Header /><p>My Name is {name}. I like to eat:</p><List />
        <p id={timeChange(time)}>This website was created in {year}</p></div>
  );
}

export default App;
